  return (
    <header>
      <div>
        <Link to="/">
          <img src={Logo} alt="Logotipo Spotify" />
        </Link>
        <span>
          <Link to="/faq">DÃºvidas Frequentes</Link>
          if(t.nome != null){<Link to="/cadastro">Cadastre-se</Link>}else
          {<Link to="/cadastro">t.nome</Link>}
